declare function getMobs(): Array<{
    id: string;
    cell: string;
    life: string;
}>;

/**
 * Return the mob with the lowest life
 */
declare function getLowestLifeMob(): {
    id: string;
    cell: string;
    life: string;
};

/**
 * Return the nearest mob
 */
declare function getNearestMob(): Promise<{
    id: string;
    cell: string;
    life: string;
}>;

