// =============================================================================
// TRANSPORTATION FUNCTIONS
// =============================================================================

/**
 * Join your spouse
 */
declare function joinSpouse(): Promise<void>;

/**
 * Ride your mule
 */
declare function rideMule(): Promise<void>;

/**
 * Mount your dd
 */
